const MovieByDirector = ({movie}) => {



  return(
    <>
    <div className='Item-box'></div>
    <Link to={`/movie/${movie.imdbID}`}><h3>{movie.Title}</h3></Link>

    <Link to={`/movie/${movie.imdbID}`}><img src={movie.Poster} className='img'/></Link>

    </>
  )
}

export default MovieByDirector;
